import React from 'react';
import './Education.css';

class Education extends React.Component {
  constructor(props) {
    super(props);
  }

  render(){
  	return(
  		<div className='about-me-container'>
	        <img src={yuga01} class='about-me-icon'/>
	        <div className='about-me-main'>
	          <div className='main-title'>
	          About Me
	          </div>
	          <div className='about-me-contents'>
	          I'm a mobile developer with 5 years of solid experience who is also skilled in backend development. Extensive experience working for startup companies, directly contributing to their partnerships with well-known corporations or significantly growing their user bases. Ability to see overall picture of technical issues for a company, manage a team and provide directions that align with the overall goals of the company.
	          </div>
	        </div>
	     </div>
  	);
  }
}

export default Education;
